export default function Eduction(props){
    let education=props.content;
    return(
        <div className="flex flex-wrap gap-3 items-center">
            {
                education.map((el,index)=>(
                    <>
                        <div className="flex-3 bg-slate-50 p-3 flex-none shadow-xl rounded">
                            <p className="text-indigo-500 font-bold text-xl">{el.degree}</p>
                            <p className="font-bold">{el.institute}</p>
                            <p className="text-slate-500 font-bold">{el.duration}</p>
                        </div>
                        {index!=education.length-1&&<div className="flex gap-3 items-center flex-1">
                            <hr className="flex-auto border-1 border-dashed border-indigo-500"></hr>
                            <div className="p-8 rounded-full bg-slate-100 flex justify-center items-center w-64 h-64 shadow-xl">
                                <img src="https://findbestcourses.com/wp-content/uploads/2021/11/test.png" className="dropShadow w-full"></img>
                            </div>
                            <hr className="flex-auto border-1 border-dashed border-indigo-500"></hr>
                        </div>}
                    </>
                ))
            }
        </div>
    )
}
